import './assets/css/style.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { useSelector } from 'react-redux';

function App() {
  const state = useSelector(state => state)

  const movie_one = state.movie_one.initialState
  const movie_two = state.movie_two.initialState
  const movie_tre = state.movie_three.initialState

  console.log(movie_one);
  console.log(movie_two);
  console.log(movie_tre);
  return (
    <div className="container">
      <MovieOne {...movie_one} />
    </div>
  );
}

export default App;
